import logo from "./logo.svg";
import "./App.css";
const Hello = () => {
  return (
    <div>
      <p>Hello world</p>
    </div>
  );
};
function App() {
  const now = new Date();
  const a = 10;
  const b = 20;
  console.log(now, a + b);
  console.log("Hello from component");
  return (
    <div>
      <h1>Greetings</h1>
      <Hello />
    </div>
  );
}

export default App;
